import Home from './home';
import {Sw, Route, BrowserRouter} from 'react-router-dom';
import Transactions from './Transactions';
function App() {
  return(
    <BrowserRouter>
    <div>
      <Home />
      <Switch>
        <Route path="/transactions" element={<Transactions />} />
      </Switch>
    </div>
  </BrowserRouter>
  )
}
export default App;
